import React from "react";
import ImageComp from "../../atom/Image";
import { Box, Typography, styled } from "@mui/material";
import CardImage from "../../../images/card-imgBig.svg";
import ImageConstructor from "../../atom/imageConstructor";
import { log } from "console";

interface IImageCardDetail {
  objectNumber: string;
  longTitle: string;
}
const RootBox = styled(Box)({
  position: "absolute",
  left: "0px",
  right: "0px",
//   top: "56px",
//   bottom: "512px",
  borderRadius: "8px"
});

const TextBox = styled(Box)({
    position: "absolute",
    left: "33px",
    top: "814px",
    color: "white"
  });

const ImageCardDetail = ({objectNumber, longTitle}: IImageCardDetail) => {
  console.log("Long title: "+ longTitle);
  return (
    <RootBox data-testid="molecule-CardDetail">
      <ImageConstructor width={1000} height={400} id={objectNumber} />
      <TextBox>
      <Typography variant="h1" children={longTitle} />
      </TextBox>
    </RootBox>
  );
};

export default ImageCardDetail;
